import React from 'react'; 

const NumericKeypad = ({ showKeypad, onClearInput, onAppendNumber }) => {
    return (
        <div id="numericKeypad" style={{ display: showKeypad ? 'block' : 'none' }}>
      {[1, 2, 3, 4, 5, 6, 7, 8, 9, 0, 'Clear'].map((num) => (
        <button key={num} onClick={() => (num === 'Clear' ? onClearInput() : onAppendNumber(num))}>
          {num}
        </button>
        ))}
    </div>
    );
}

export default NumericKeypad
